import React, { useState, useEffect } from "react";
import { getCrashes } from "./api";

export default function CrashList() {
    const [values, setValues] = useState({
        crashList: [],
        error: "",
    });
    const { crashList, error } = values;

    const init = () => {
        getCrashes().then(data => {

                setValues({
                    ...values,
                    crashList: data
                });

        });
    };

    useEffect(() => {
        init();
    }, []);

    return (
        <div>
            hi
            {crashList}
        </div>
    );
};
